import styled from 'styled-components';

export const Navigation = styled.header`
  height: 5rem;
  padding: 1rem;
`

export const NavMenu = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
`

export const NavItems = styled.ul`
  list-style: none;
  display: flex;
  align-items: center;
  gap: 1.5rem;
`

export const NavLink = styled.a`


    svg {
      width: 4.3rem;
      color: #397f6e;
    }
`
